import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';

import api from '../../services/api';

import './styles.css';

    
export default function Init(){
    const history = useHistory();/*
    const [name, setName] = useState('');
    const [description, setDescription] = useState('');
    const [city, setCity] = useState('');
    const [uf, setUf] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');*/
    const [petshops, setPetshops] = useState([]);

     useEffect(()=> {
         api.get('init').then(response =>{setPetshops(response.data);} )
     });
    
    async function handlePetshops(e){
        e.preventDefault();

        const dataPetshops = {
        name, description, city, uf, email, phone
       }
       try{
           await api.get('petshops', dataPetshops);
       }catch(err){
           
       }
       history.push('/init');
    }
    /*useEffect(() =>{
        api.get('inicial', {
            
        }).then(response =>{
            setPetshops(response.data);
        })
    }, []); */
    //{petshops.map(petshops => (
    return (
        <div classname="profile-container">
            
            <h1>Petshops Cadastrados</h1>
            <form onSubmit={handlePetshops}>
            <ul>
               {petshops = (
               <li>
                    <strong>NOME DO PETSHPOP:</strong>
               <p>{petshops.name}</p>
                    
                    <strong>DESCRIÇÃO:</strong>
               <p>{petshops.description}</p>

                    <strong>CIDADE:</strong>
               <p>{petshops.description}</p>

                    <strong>UF:</strong>
               <p>{petshops.uf}</p>

                    <strong>EMAIL:</strong>
               <p>{petshops.email}</p>

                    <strong>TELEFONE:</strong>
               <p>{petshops.phone}</p>
                    
                </li>
                )}
            </ul>
            </form>
        </div>
    );
};
